import React, {Component} from 'react'
import './assets/css/Sidebar.scss'
import list from '../list'

console.log(list)

class Sidebar extends Component {
    render() {
        return (
            <div className="sidebar">
                <div className="container">{list.map((item) => (
                    <div>
                        <div>{item.name}</div>
                        <div>{item.dirs}</div>
                        <div>{item.files}</div>
                    </div>
                ))}</div>
            </div>
        )
    }
}

export default Sidebar
